  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:20.899543\",\n\t\"name\": \"prime-hook-national-wildlife-refuge-photo-arrays-of-delmarva-fox-squirrel-dfs-and-photomon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary goal of this photomonitoring
  effort was to determine the status of Prime Hook National Widlife Refuge (PHNWR)
  Delmarva Fox Squirrel (Sciurus niger cinereus, DFS) during the spring and summer
  of 2011. Delmarva fox squirrels were documented at the refuge  during photomonitoring
  efforts in 2004 and 2008. DFS monitoring efforts prior to 2004 consisted of trapping
  and mark-recapture efforts, DFS nest box monitoring and road mortality reports.
  This project in 2011 was conducted by Delaware Division of FIsh and Wildlife, Natural
  Heritage and Endangered Species Program (NHESP) and refuge staff. This unpublished
  report was prepared by the Delaware Division of Fish and Wildlife NHESP) and edited
  by PHNWR Wildlife Biologist (A. Larsen). The report includes methodogy descriptions
  of photomonitoring techniques used, results and discussion sections and an updated
  and revised (Jan 27, 2010) Photomonitor Survey Protocol for DFS.\",\n\t\"license_title\":
